con:configuration.scriptText:
import com.eviware.soapui.support.XmlHolder

def holder = new XmlHolder(messageExchange.responseContentAsXml)
log.info holder


holder.namespaces['ns']='https://primus.grindr.com/1.9/login';
def authenticationtoken = holder.getNodeValue('//ns:Response/ns:Body/ns:e/ns:authenticationToken')
log.info authenticationtoken
assert(authenticationtoken != null)
messageExchange.modelItem.testStep.testCase.testSuite.setPropertyValue("AuthToken",authenticationtoken)

def profileId = holder.getNodeValue('//ns:Response/ns:Body/ns:e/ns:profileId')
log.info profileId
assert(profileId != null)
messageExchange.modelItem.testStep.testCase.testSuite.setPropertyValue("ProfileId",profileId)
